import React, { Component } from 'react';
import CCard from './CCard';

class BCard extends Component {
  constructor(props) {
    super(props)
    this.state = {}    
  }

  render() {
    return (
    <div style>
      {this.props.value.map((cCardItem,cCardIndex)=>{
        return (<CCard key={cCardIndex} style={this.props.style} value={cCardItem.value}></CCard>)
      })}
    </div>
    )
  }

}

export default BCard;
